            initial={{backgroundColor:"green",opacity:0}}
                whileInView={{backgroundColor:"red",opacity:1}}
                animate={{backgroundColor:"blue"}}
               
                transition={{duration:0.5,repeat:Infinity}}> </section>
            <div className="div2" 
                >
                <motion.h1  >slfjsl</motion.h1>
               
                 </div>
                 <Box/>
        </div>
    )
        
    
}
